import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import { bookmarkedAddresses, bookmarkedPredictions, bookmarkedComparisons } from './bookmarks';
import './user.css';

const User = () => {
  const [activeTab, setActiveTab] = useState('dashboard');
  const navigate = useNavigate();

  // Get user type from localStorage
  const userType = localStorage.getItem('userType') || 'free';

  // Handler functions for view buttons
  const handleBookmarkedAddressView = (address) => {
    // Navigate to price prediction with the address
    navigate('/dashboard/priceprediction', { 
      state: { 
        prefillAddress: address,
        fromBookmark: true 
      } 
    });
  };

  const handlePropertyView = (property) => {
    // Navigate to property listing page
    navigate(`/dashboard/property-listing/${property.id}`);
  };

  const handleComparisonView = (comparison) => {
    // Navigate directly to comparison results page
    navigate('/dashboard/comparison', { 
      state: { 
        properties: [
          {
            id: Date.now(),
            propertyType: comparison.propertyType || 'Industrial Property',
            address: comparison.address1,
            floorArea: '1500',
            level: 'Ground Floor',
            unit: 'A-01'
          },
          {
            id: Date.now() + 1,
            propertyType: comparison.propertyType || 'Commercial Space',
            address: comparison.address2,
            floorArea: '2000',
            level: 'Level 1',
            unit: 'B-15'
          }
        ],
        fromBookmark: true 
      } 
    });
  };

  const handlePredictionView = (prediction) => {
    // Navigate directly to prediction results page
    navigate('/dashboard/prediction', { 
      state: { 
        searchData: {
          address: prediction.address,
          propertyType: prediction.propertyType,
          floorArea: prediction.floorArea,
          level: prediction.level,
          unit: prediction.unit
        },
        fromBookmark: true 
      } 
    });
  };

  return (
    <div className="user-dashboard">
      {/* Top Header */}
      <Header />

      <div className="user-dashboard-container">
        {/* Left Sidebar */}
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />

        {/* Main Content */}
        <main className="user-main-content">
          <div className="user-content-header">
            <h1 className="user-main-title">User's Dashboard</h1>
            <p className="user-welcome-message">Welcome back, Amelia</p>
          </div>

          <div className="user-dashboard-sections">
            {/* Bookmarked Addresses */}
            <section className="user-dashboard-section">
              <div className="user-section-header">
                <h2 className="user-section-title">Bookmarked Addresses</h2>
                <button 
                  className="user-view-more-btn"
                  onClick={() => navigate('/bookmarks')}
                >
                  View More
                </button>
              </div>
              <div className="user-address-list">
                {bookmarkedAddresses.map((address) => (
                  <div key={address.id} className="user-address-item">
                    <span className="user-address-text">{address.address}</span>
                    <button 
                      className="user-view-btn"
                      onClick={() => handleBookmarkedAddressView(address.address)}
                    >
                      View
                    </button>
                  </div>
                ))}
              </div>
            </section>

            {/* Comparisons - Only for Premium Users */}
            {userType === 'premium' && (
              <section className="user-dashboard-section">
                <div className="user-section-header">
                  <h2 className="user-section-title">Bookmarked Comparisons</h2>
                  <button 
                    className="user-view-more-btn"
                    onClick={() => navigate('/bookmarks')}
                  >
                    View More
                  </button>
                </div>
                <div className="user-address-list">
                  {bookmarkedComparisons.map((comparison) => (
                    <div key={comparison.id} className="user-address-item">
                      <span className="user-address-text">{comparison.title}</span>
                      <button 
                        className="user-view-btn"
                        onClick={() => handleComparisonView(comparison)}
                      >
                        View Results
                      </button>
                    </div>
                  ))}
                </div>
              </section>
            )}

            {/* Predictions */}
            <section className="user-dashboard-section">
              <div className="user-section-header">
                <h2 className="user-section-title">Bookmarked Predictions</h2>
                <button 
                  className="user-view-more-btn"
                  onClick={() => navigate('/bookmarks')}
                >
                  View More
                </button>
              </div>
              <div className="user-address-list">
                {bookmarkedPredictions.map((property) => (
                  <div key={property.id} className="user-address-item">
                    <span className="user-address-text">{property.propertyType} - {property.address}</span>
                    <button 
                      className="user-view-btn"
                      onClick={() => handlePredictionView(property)}
                    >
                      View Results
                    </button>
                  </div>
                ))}
              </div>
            </section>

            {/* Recommended Properties - Using some bookmarked addresses as examples */}
            <section className="user-dashboard-section">
              <div className="user-section-header">
                <h2 className="user-section-title">Properties you might be interested in:</h2>
                <button 
                  className="user-view-more-btn"
                  onClick={() => navigate('/dashboard/property-listings')}
                >
                  View More
                </button>
              </div>
              <div className="user-property-grid">
                {bookmarkedAddresses.slice(0, 2).map((property) => (
                  <div key={property.id} className="user-property-card">
                    <div className="user-property-info">
                      <h3 className="user-property-name">{property.type} - {property.address.split(',')[0]}</h3>
                      <p className="user-property-value">Estimated Value: {property.estimatedValue}</p>
                    </div>
                    <div className="user-property-image">
                      <img src={property.mapImage} alt={property.address} />
                    </div>
                                                 <button 
                               className="user-view-btn"
                               onClick={() => handlePropertyView(property)}
                             >
                               View
                             </button>
                  </div>
                ))}
              </div>
            </section>
          </div>
        </main>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default User;
